import React from 'react';

const NavBar = () => {
    const logoStyle = {
        fontFamily: "'Abril Fatface', cursive",
    }
    const Classes = {
        logo: "font-bold text-3xl",
        daily: "text-red-600 tracking-tighter",
        news: "tracking-widest",
        navItems: "mx-3 text-xl",
    }

    return (
        <div className="bg-white flex justify-between p-5">
            <section>
                <span style={logoStyle} className={Classes.logo}>
                    <span className={Classes.daily}>DAILY</span>
                    <span className={Classes.news}>NEWS</span>
                </span>
            </section>
            <section>
                <span className="mx-3 text-xl">Home</span>
                <span className="mx-3 text-xl">World</span>
                <span className="mx-3 text-xl">Technology</span>
                <span className="mx-3 text-xl">Sport</span>
                <span className="mx-3 text-xl">Entertainment</span>
            </section>
            <section>
                <button className="mx-2 bg-blue-500 rounded text-white px-3">Login</button>
                <button className="mx-2 bg-blue-500 rounded text-white px-3">Logout</button>
            </section>
        </div>
    );
};

export default NavBar;
